import React, { Component } from "react";
import {
  Card,
  CardImg,
  CardImgOverlay,
  CardText,
  CardBody,
  CardTitle
} from "reactstrap";

class DishdetailComponent extends Component {
  render() {
    return (
      <div className="row">
        <div className="col-12 col-md-5 m-1">
          <Card>
            <CardTitle>{this.props.selectedDish.image}</CardTitle>
          </Card>
        </div>
      </div>
    );
  }
}
export default DishdetailComponent;
